//page()内的函数，需要使用this.functionName()调用
//page()外的为全局函数，可直接调用
function getUserIDByCode(code) {
  console.log('code is:', code);
  wx.request({
    url: 'https://api.weixin.qq.com/sns/jscode2session?grant_type=authorization_code',
    data: {
      appid: 'wx703d6672412cd83f',
      secret: '039aeda1c8fd41992672de084891b407',
      js_code: code
    },
    success: function (res) {  // 登录成功
      console.log('res:', res);
      if (res.statusCode === 200) {
        console.log(res.header);
        console.log(res.data);// 服务器回包内容
      }
    }
  })
}

